    }

    private async Task Remove()
    {
        try
        {
            Appointment appointment = new Appointment();
            foreach (var ap in AllAppointments)
            {
                if (ap.id == apptId)
                    appointment = ap;
            }
            await CloudAppointmentService.RemoveAppointment(appointment);
            AllAppointments = await CloudAppointmentService.GetAllForPatient(user.idNr);
            ValidAppt.Clear();
            foreach (var appt in AllAppointments)
            {
                if (appt.startTime.Date.CompareTo(DateTime.Today) >= 0)
                {
                    ValidAppt.Add(appt);
                }
            }
        }
        catch (Exception e)
        {
            Console.WriteLine(e.Message);
        }
    }
    
    private async Task SelectRecord()
    {
        display2 = "display:block";
        selectedRecord = await CloudMedicalRecordService.GetMedicalRecord(patientRecId);
        if (selectedRecord != null)
        {
            if (selectedRecord.content != null && selectedRecord.content.Length > 0)
            {
                selectedRecordString = Encoding.Default.GetString(selectedRecord.content);
            }
            else
            {
                selectedRecordString = "No Medical Record yet registered on the platform!";
            }
        }
        else
        {
            selectedRecordString = "No Medical Record yet registered on the platform!";
        }
        newEntry = "";
    }

    private async Task AddChanges()
    {
        if (!newEntry.Equals(""))
        {
            MedicalRecord record = new MedicalRecord();
            record.patientId = patientRecId;
            record.content = Encoding.Default.GetBytes(newEntry);
            await CloudMedicalRecordService.AddMedicalRecord(record);
            display2 = "display:none";
        }
    }


